import {Route, Switch} from 'react-router-dom'
import React from "react";
import GlobalFeed from 'pages/globalFeed';
import Store from 'pages/store'
import RegistrationRules from 'pages/signUp/registrationRules'

export default () => {
    return(
        <Switch>
            <Route path='/' component={GlobalFeed} exact/>
            <Route path='/autostore/:slug' component={Store} />
            <Route path='/regrules' component={RegistrationRules}/>
        </Switch>
    )
}
